import React,{Component} from 'react';
import email from './components/email';
import guide from './components/guide';
import Guide from './components/guide';
// import {Route, BrowserRouter as Router, Switch} from 'react-router-dom';
// import { useRouter as Router,Switch, Route } from 'next/router'
import Router, {Switch,Route} from 'next/router'

import css from '../style.css';
import Nav from './components/nav';
import Link from 'next/link'
import toogle from '../public/google';
class App extends Component {
render(){
  return (
    <div className={css.App}>
     <Router>
      <div className={css.head}><Nav /></div>
      <Switch>
        <Route path='/' exact component={guide} />
        <Route path='/email'  component={email} />
        <Route path='/toogle' component={toogle} />
      </Switch>
      </Router>

      {/* <Email /> */}
    </div>
  );
  }
}
export default App;
